    "2015-10-11T19:13:51.655619",nt"name": "wsa-enlil-solar-wind-prediction",nt"isopen":
    false,nt"url": null,nt"notes": "WSA-Enlil is a large-scale, physics-based
    prediction model of the heliosphere, used by the Space Weather Forecast Office to
    provide 1-4 day advance warning of solar wind structures and Earth-directed coronal
    mass ejections (CMEs) that cause geomagnetic storms.  Solar disturbances have long
    been known to disrupt communications, wreak havoc with geomagnetic systems, and
    to pose dangers for satellite operations.",nt"license_title": null,nt"extras":
